import React from "react";
import { BarChart, Bar, XAxis, YAxis, Tooltip, Legend } from "recharts";

// Dummy Data
const data = [
  {
    name: "Anaphylaxis",
    Pfizer: 4000,
    Moderna: 2400,
  },
  {
    name: "Fatigue",
    Pfizer: 3000,
    Moderna: 1398,
  },
  {
    name: "Muscle pain",
    Pfizer: 2000,
    Moderna: 9800,
  },
  {
    name: "Fever",
    Pfizer: 2780,
    Moderna: 3908,
  },
  {
    name: "Pain",
    Pfizer: 1890,
    Moderna: 4800,
  },
];



const BarChartHome = () => {
  return (
    <BarChart width={500} height={300} data={data} stackOffset="expand">
      <XAxis dataKey="name" />
      <YAxis
        domain={[`${0}%${100}%`]}
      />
      <Tooltip />
      <Legend />
      <Bar dataKey="Pfizer" fill="#8884d8" />
      <Bar dataKey="Moderna" fill="#82ca9d" />
    </BarChart>
  );
};

export default BarChartHome;
